  width: 80vw;
  display: flex;
`;

const Title = styled.h1`
  font-size: ${(props) => props.theme.fontbig};
  font-family: "Kaushan Script";
  font-weight: 300;
  position: absolute;
  top: 1rem;
  left: 5%;
  z-index: 5;
`;

const Left = styled.div`
