`;
const Right = styled.div`
  width: 50%;
`;

const About = () => {
  return (
    <Section>
      <Title
        data-scroll
        data-scroll-speed="-2"
        data-scroll-direction="horizontal"
      >
        About Us
      </Title>

      <Left> TEXT</Left>
      <Right> IMAGES</Right>
    </Section>
  );
};

export default About;
